import React, {useState} from 'react';

function ForumPosts(props) {
    return(
        <div>
            {this.state.posts_list && this.state.posts_list.map(p => {
                const title = p.title;
                const publisher = p.publisher;
                const content = p.content;
                const cost = p.Cost;

            return (
                <div>
                    <h1>{title}</h1>
                    <p>{publisher}</p>
                    <p>{content}</p>
                    <p>{cost}</p>
                </div>
               )
            })}
            </div>
       );
}

export default ForumPosts;
